daf267dc58c%22%2C%22title%22%3A%22Testing%22%2C%22description%22%3A%22%22%2C%22duration%22%3A1%2C%22pageLink%22%3A%7B%7D%7D%2C%7B%22rowIndex%22%3A0%2C%22startDate%22%3A%222015-11-30%2002%3A36%3A49%22%2C%22id%22%3A%224f584dc6-63b8-4efa-a98e-a5d7bbe9910e%22%2C%22title%22%3A%22Deploy%22%2C%22description%22%3A%22%22%2C%22duration%22%3A1.0297029702970297%2C%22pageLink%22%3A%7B%7D%7D%5D%7D%5D%2C%22markers%22%3A%5B%7B%22title%22%3A%22Yearly%20Finalisation%22%2C%22markerDate%22%3A%222015-11-29%2012%3A21%3A23%22%7D%5D%7D</ac:parameter><ac:parameter ac:name=\"title\">Roadmap%20Planner</ac:parameter><ac:parameter ac:name=\"hash\">f0477dfac6f6ca380d8c5f2f44041947</ac:parameter></ac:structured-macro></p><p>&nbsp;</p><h1><strong>Know your spaces</strong>&nbsp;</h1><p>Everything your team is working on - meeting notes and agendas, project plans and timelines, technical documentation and more - is located in a space; it\'s home base for your team.</p><p>A small team should plan to have a space for the team, and a space for each big project. If you\'ll be working in Confluence with several other teams and departments, we recommend a space for each team as well as a space for each major cross-team project. The key is to think of a space as the container that holds all the important stuff - like pages, files, and blog posts - a team, group, or project needs to work.</p><h1><strong>Know your pages</strong></h1><p>If you\'re working on something related to your team - project plans, product requirements, blog posts, internal communications, you name it - create and store it in a Confluence page. Confluence pages offer a lot of flexibility in creating and storing information, and there are a number of useful page templates included to get you started, like the&nbsp;meeting notes template. Your spaces should be filled with pages that document your business processes, outline your plans, contain your files, and report on your progress. The more you learn to do in Confluence (adding tables and graphs, or embedding video and links are great places to start), the more engaging and helpful your pages will become.</p><p>Learn more by reading&nbsp;<a href=\"https://www.atlassian.com/collaboration/confluence-organize-work-in-spaces\">Confluence 101: organize your work in spaces</a></p><p>&nbsp;</p><hr /></ac:layout-cell><ac:layout-cell><h1><strong>Quick navigation</strong></h1><p>When you create new pages in this space, they\'ll appear here automatically.</p><p><ac:structured-macro ac:macro-id=\"8ca379f2-ea2a-4fbb-bf4a-77619f9875ed\" ac:name=\"children\" ac:schema-version=\"2\" /></p><h1><strong>Useful links</strong></h1><table><tbody><tr><th>Link</th><th>Description</th></tr><tr><td><a href=\"https://www.atlassian.com/collaboration/confluence-organize-work-in-spaces\">Confluence 101: organize your work in spaces</a></td><td><p>Chances are, the information you need to do your job lives in multiple places. Word docs, Evernote files, email, PDFs, even Post-it notes. It\'s scattered among different systems. And to make matters worse,&nbsp;<em>the stuff your teammates need is equally siloed</em>. If information had feelings, it would be lonely.</p><p>But with&nbsp;Confluence, you can bring all that information into one place.</p></td></tr><tr><td><a href=\"https://www.atlassian.com/collaboration/confluence-discuss-work-with-your-team\">Confluence 101: discuss work with your team</a></td><td>Getting a project outlined and adding the right content are just the first steps. Now it\'s time for your team to weigh in.&nbsp;Confluence&nbsp;makes it easy to discuss your work - with your team, your boss, or your entire company - in the same place where you organized and created it.</td></tr><tr><td colspan=\"1\"><a href=\"https://www.atlassian.com/collaboration/confluence-create-content-with-pages\">Confluence 101: create content with pages</a></td><td colspan=\"1\">Think of pages as a New Age &quot;document.&quot; If Word docs were rotary phones, Confluence pages would be smart phones. A smart phone still makes calls (like their rotary counterparts), but it can do so much more than that</td></tr></tbody></table><p><strong style=\"font-size: 24.0px;line-height: 1.25;\"><br /></strong></p><p><strong style=\"font-size: 24.0px;line-height: 1.25;\">Tasks</strong></p><table><tbody><tr><td><ac:task-list>\n<ac:task>\n<ac:task-id>59</ac:task-id>\n<ac:task-status>incomplete</ac:task-status>\n<ac:task-body><a href=\"https://confluence.atlassian.com/x/NgszKw\">Customize the name, colour, and icon of Confluence</a>.</ac:task-body>\n</ac:task>\n<ac:task>\n<ac:task-id>56</ac:task-id>\n<ac:task-status>incomplete</ac:task-status>\n<ac:task-body>Decide who can see and edit this space or a specific page by clicking the <ac:image><ri:attachment ri:filename=\"lock-icon.png\" /></ac:image> icon. Learn more about <a href=\"https://confluence.atlassian.com/x/liAC\">Page Restrictions</a> and <a href=\"https://confluence.atlassian.com/x/ASEC\">Space Permissions</a>.</ac:task-body>\n</ac:task>\n<ac:task>\n<ac:task-id>57</ac:task-id>\n<ac:task-status>incomplete</ac:task-status>\n<ac:task-body>Try adding an <a href=\"https://confluence.atlassian.com/x/2yAC\">inline comment</a> by highlighting some text and click the comment icon.</ac:task-body>\n</ac:task>\n<ac:task>\n<ac:task-id>58</ac:task-id>\n<ac:task-status>incomplete</ac:task-status>\n<ac:task-body>Learn more about <a href=\"https://confluence.atlassian.com/x/SRwC\">inviting your team to Confluence</a>.</ac:task-body>\n</ac:task>\n</ac:task-list>\n</td></tr></tbody></table></ac:layout-cell></ac:layout-section></ac:layout>', 327700, 2),
