(589835, '<ac:layout><ac:layout-section ac:type=\"single\"><ac:layout-cell>\n<ac:structured-macro ac:name=\"tip\" ac:schema-version=\"1\" ac:macro-id=\"56f579ca-077d-4954-8a18-53edaccfcea0\"><ac:parameter ac:name=\"title\">欢迎来到您的新空间！</ac:parameter><ac:rich-text-body><p>Confluence 空间非常适合用来与您的团队分享内容和消息。这是您的主页。现在这里显示最近的空间活动，但是您可以用您喜欢的任何方式来自定义这个页面。</p></ac:rich-text-body></ac:structured-macro><h2>完成这些任务后开始。</h2><ac:task-list>\n<ac:task>\n<ac:task-id>1</ac:task-id>\n<ac:task-status>incomplete</ac:task-status>\n<ac:task-body><strong>编辑这个主页</strong> - 点击屏幕右上方的<em>编辑</em>来自定义您的空间主页。</ac:task-body>\n</ac:task>\n<ac:task>\n<ac:task-id>2</ac:task-id>\n<ac:task-status>incomplete</ac:task-status>\n<ac:task-body><strong>创建您的首个页面</strong> - 点击页头上的<em>创建</em>按钮开始。</ac:task-body>\n</ac:task>\n<ac:task>\n<ac:task-id>3</ac:task-id>\n<ac:task-status>incomplete</ac:task-status>\n<ac:task-body><strong>给您的空间打上印记</strong> - 点击左侧面板上的<em>配置侧栏</em>来更新空间细节和标识。</ac:task-body>\n</ac:task>\n<ac:task>\n<ac:task-id>4</ac:task-id>\n<ac:task-status>incomplete</ac:task-status>\n<ac:task-body><strong>设置权限</strong> - 点击左边侧栏上的<em>空间工具</em>来更新权限允许其他人访问。</ac:task-body>\n</ac:task>\n</ac:task-list><p>&nbsp;</p></ac:layout-cell></ac:layout-section><ac:layout-section ac:type=\"two_equal\"><ac:layout-cell>\n<h2>最近的空间活动</h2><p><ac:structured-macro ac:name=\"recently-updated\" ac:schema-version=\"1\" ac:macro-id=\"855aed12-7da6-4ff8-a3cf-46c1df68f111\"><ac:parameter ac:name=\"types\">page, comment, blogpost</ac:parameter><ac:parameter ac:name=\"max\">5</ac:parameter><ac:parameter ac:name=\"hideHeading\">true</ac:parameter><ac:parameter ac:name=\"theme\">social</ac:parameter></ac:structured-macro></p></ac:layout-cell><ac:layout-cell>\n<h2>空间贡献者</h2><p><ac:structured-macro ac:name=\"contributors\" ac:schema-version=\"1\" ac:macro-id=\"6b428317-958a-435b-a8f2-f10eff0ca59e\"><ac:parameter ac:name=\"mode\">list</ac:parameter><ac:parameter ac:name=\"scope\">descendants</ac:parameter><ac:parameter ac:name=\"limit\">5</ac:parameter><ac:parameter ac:name=\"showLastTime\">true</ac:parameter><ac:parameter ac:name=\"order\">update</ac:parameter></ac:structured-macro></p></ac:layout-cell></ac:layout-section><ac:layout-section ac:type=\"single\"><ac:layout-cell>\n<p>&nbsp;</p></ac:layout-cell></ac:layout-section></ac:layout>', 327707, 2),
